import './Chart1.css';
import { VictoryChart, VictoryBar, VictoryAxis, VictoryTheme } from 'victory';


function Chart1({resultList, jobList,}){
    const quarterArray = [1,2,3,4];

    const convertedResults = resultList.map(item => (typeof item === 'number' ? item : 0));
    const max = Math.max(convertedResults);
    console.log(max)
    for(let i=0;i<convertedResults.length;i++){
        console.log(convertedResults[i])
    }


    const data = jobList.map((jobs,index)=>({
    salary : resultList[index+2],
    job : jobs
    }))

    //console.log(maxValue)

    return (
        <div className='chart'>
            <VictoryChart theme={VictoryTheme.grayscale} domainPadding={50}>
            <VictoryAxis
                // X ekseni etiketlerini ayarla
                tickValues={quarterArray}
                tickFormat={jobList}
            />
            <VictoryAxis
                dependentAxis
                // Y ekseninin etiket aralığını ayarla
                tickFormat={(x) => `${x/2}`}
            />
            <VictoryBar
                data={data}
                x="job"
                y="salary"
                style={{
                data: { fill: "grey" }
                }}
            />
            </VictoryChart>
        </div>
    );
    };

export default Chart1;
